import React from "react";
import "../styles/Home.css";

const Home = () => {
  return ( <
    div className = "home" >
    <
    div className = "rectangle-background" >
    <
    div className = "date-and-icon" > < /div> <
    div className = "title" >
    <
    h2 > Lucila < /h2> <
    span className = "middle-title" > & < /span> <
    h2 > Luciano < /h2> <
    /div>

    <
    p >
    "Y mis ojos, versus su sonrisa, <br /> terminaron por tirar la
    fachada " <
    /p> <
    /div> <
    /div>
  );
};

export default Home;
